.card-header {
  span {
    font-size: 18px;
    font-weight: 700;
  }
}
.single-container {
  .single-card {
    margin: 15px 20px;
    &-item {
      &-value {
        font-size: 28px;
        font-weight: 400;
        margin: 0;
        color: #409EFF;
        padding-bottom: 10px;
        border-bottom: 1px solid #DCDFE6;
      }
      &-header {
        font-size: 13px;
        color: #606266;
        margin: 0;
        margin-bottom: 10px;
        i {
          float: right;
        }
      }
      &-ava {
        margin: 0;
        font-size: 15px;
        overflow: hidden;
        margin-top: 10px;
        span {
          float: right;
          b {
            font-weight: 500;
            color: #409EFF;
          }
        } 
      }
      /deep/ .el-icon-info:hover {
        cursor: pointer;
      }
    }
  }
  .all-card {
    margin: 15px 20px;
    .charts-container{
      height: 350px;
      // border: 1px solid black;
      margin: 0 auto;
      margin-top: 30px;
    }
    #charts {
      // border: 1px solid black;
      margin: 0 auto;
      width: 700px;
      height: 300px;
    }
  }
}
